import {BrowserRouter,Routes, Route} from "react-router-dom"
import UserLogin from "./componets/UserLogin";
import Home from "./componets/Home"



function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<UserLogin />} />
        <Route path="/home" element={<Home />} />
      </Routes>
    </>
  );
}

export default App;
